data:
  definition: séquence dans laquelle les contacts avec une longueur d’accouplement
    différente s’accouplent dans le but de fournir des forces d’insertion échelonnées
    et/ou une continuité électrique échelonnée
  examples: []
  notes:
  - Séquence peut être par exemple, premier contact/dernière coupure.
